Actionscript.script:
攻击时移动 = _root.敌人二级函数.攻击时移动;
Z轴追踪移动 = _root.敌人二级函数.Z轴追踪移动;
计算攻击角度 = _root.敌人二级函数.计算攻击角度;
固定角度移动 = _root.敌人二级函数.固定角度移动;

//这里X轴追踪移动的参数跟模板有点不一样，懒得统一了
function X轴追踪移动(最小移动距离, 最大移动距离)
{
	if (_parent.攻击目标 == "无")
	{
		return;
	}
	var distance = _root.gameworld[_parent.攻击目标]._x - _parent._x;
	if (_parent.方向 == "左")
	{
		distance = -distance;
	}
	distance = Math.max(distance, 最小移动距离);
	distance = Math.min(distance, 最大移动距离);
	攻击时移动(distance,distance);
}


//子弹生成
function 近战攻击()
{
	var 子弹 = _root.子弹属性初始化(this.攻击点);
	子弹.声音 = "";
	子弹.霰弹值 = 1;
	子弹.子弹散射度 = 0;
	子弹.子弹种类 = "近战子弹";
	子弹.子弹威力 = _parent.空手攻击力;
	子弹.子弹速度 = 0;
	子弹.击中地图效果 = "";
	子弹.Z轴攻击范围 = 30;
	子弹.击倒率 = 8;
	子弹.击中后子弹的效果 = "";
	子弹.水平击退速度 = 10;
	子弹.区域定位area = this.攻击点;
	_root.子弹区域shoot传递(子弹);
}

